import { CubesIcon } from '@patternfly/react-icons';
import { Link } from 'react-router-dom';
import { StateCard } from '../EmptyStates/StateCard';
import { PageLayout } from '../PageLayout/PageLayout';

interface IKeycloakFailedPage {
  title?: string;
}

export const KeycloakFailedPage = ({ title }: IKeycloakFailedPage) => {
  return (
    <PageLayout title={title ? title : 'Error page'}>
      <StateCard title={`Error when loading ${title}`} icon={CubesIcon}>
        <pre>Keycloak uninitialized</pre>
        <Link to="/" className="pf-c-button pf-m-primary">
          Return to Dashboard
        </Link>
      </StateCard>
    </PageLayout>
  );
};
